import useForm from "../lib/useForm";

export default function CreateProduct() {
    const {inputs, handleChange} = useForm();
    return (
        <form>
            <label htmlFor="name">
                Name
                <input 
                    type="text" 
                    id="name" 
                    name="name" 
                    placeholder="Name"
                    value={inputs.name}
                    onChange={(e) => {
                        console.log('e.target.value', e.target.value);
                        setName(e.target.value);
                    }}
                />
            </label>
            <label htmlFor="price">
                Price
                <input
                    type="price"
                    id="price"
                    name="price"
                    placeholder="Price"
                    value={inputs.price}
                    onChange={(e) => {
                        console.log('e.target.value', e.target.value);
                        setName(e.target.value);
                    }}
                />
            </label>

        </form>
    )
};
